import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component{
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link style={linkStyle} to="/register">Register</Link></h2>
                    <hr/> 
              
            </div>
        )
    }
}

setActivePath = (activePathName) => {
    if (activePathName == window.location.pathname){
        return "blue"
    }else{
        return "black"
    }
}
const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}
const linkStyle = {
    textDecoration: "none",
    color: this.setActivePath("/register")
}

export default Navbar;
